import React from "react";
import styled from "styled-components";
import about_page from "../images/about-page.jpg";
import Container from "react-bootstrap/Container";

function About() {
    return (
        <Container className="about_us">
            <div className="about">
                This project is created to help users have an easier time finding recipes based on what they have in the fridge. In addition to the recipes, we have included a function to find restaurants around them.

            </div></Container>
    );
}

const AboutStyle = styled.div`

  display: flex;
  flex-direction: column;

   .about {
    display: block;
    margin-left: auto;
    margin-right: auto;
   }
`;

export default About;
